# Definition for singly-linked list.# class ListNode:#     def __init__(self, x):#         self.val = x#         self.next = Noneclass Solution:    def isPalindrome(self, head):        """        :type head: ListNode        :rtype: bool        """        val=[]        while head:            val.append(head.val)            head=head.next        return val==val[::-1]s=Solution()print(s.isPalindrome(J,S))